import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/Navbar';
import Slider from './components/Slider';
import Testimonial from './components/Testimonial';
import { SliderData } from './components/SliderData';
import { TestimonialData } from './components/TestimonialData';
import './App.css';
import JobSection from './components/JobSection';
import { JobSectionData } from './components/JobSectionData';
import Footer from './components/Footer';
import Banner from './components/Banner';
import Strenghts from './components/Strenghts';
import {StrenghtsData} from './components/StrenghtsData';
import ServicesSlider from './components/ServicesSlider';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Slider slides={SliderData}/>

        <Strenghts strenghts={StrenghtsData}/>
        <ServicesSlider />
        <Banner/>
        <JobSection {...JobSectionData} />
        <Footer/>
      </Router>

    </>
  );
}

export default App;
<Testimonial data={TestimonialData} />
